CREATE KEYSPACE online_shop
WITH REPLICATION = {
    'class': 'SimpleStrategy',
    'replication_factor' : 1
};

CREATE OR REPLACE FUNCTION scalar_multiplication(input1 int, input2 float)
RETURNS NULL ON NULL INPUT returns float
LANGUAGE java AS 'return input1 * input2;';

CREATE OR REPLACE FUNCTION scalar_add(input1 float, input2 float)
RETURNS NULL ON NULL INPUT returns float
LANGUAGE java AS 'return input1 + input2;';

BEGIN BATCH
      UPDATE cart SET total_price = scalar_add(37.5,scalar_multiplication(2,10)) WHERE user_id=1 IF total_price = 37.5;
      INSERT INTO cart (user_id,  product_name, quantity, price, total_product_price)
                 VALUES (1, 'Lego_Duplo', 2, 10.0, scalar_multiplication(2,10));
  APPLY BATCH;

CREATE TABLE products_coincidence_byname(
    product_name TEXT,
    coincidence_product_name TEXT,
    coincidence_times,
    PRIMARY KEY (product_name,coincidence_times)
)WITH CLUSTERING ORDER BY (coincidence_times DESC);

CREATE TABLE product_bycategory_nameorder(
    product_name TEXT,
    category TEXT;
    price FLOAT,
    PRIMARY KEY (category, product_name)
);

CREATE TABLE product_bycategory_priceorder(
    product_name TEXT,
    category TEXT;
    price FLOAT,
    PRIMARY KEY (category, price)
);
